import * as React from "react";

import {View} from 'react-native';

function MouseClicked() {
    let cartTotalQuantity=0;

    return(
        <View>
            <Text>"{cartTotalQuantity}"</Text>
        </View>
    );

}

export default {cartTotalQuantity};
